import CategoryList from "./CategoryList";
import Navi from "./Navi";
import ProductList from "./ProductList";

function App() {
  return (
    <div >
      <Container>
      <Row>
      <Navi/>
      </Row>
      <Row>
      <ProductList/>
      <CategoryList/>
      </Row>
      </Container>

    </div>
  );
}

export default App;
